import React from "react";
import { connect } from "react-redux";
import Burger from "../NavigationBar/Burger";

const LeftMenu = ({ sidebarOpen }) => {
  let x;
  let y = [];

  for (x = 0; x < 100; x++) {
    y = [...y, 1];
  }

  return (
    <div className={`left-menu-wrapper flex-col ${sidebarOpen ? "open" : ""}`}>
      <div
        className={`navbar-side h100 p8 b-primary flex-row justify-e ${
          sidebarOpen ? "open" : "hide"
        }`}
      >
        <Burger />
      </div>
      <div className="left-menu sticky flex-col b-primary">
        <div className="o-y-scroll o-x-hidden p8">
          {y.map((c) => (
            <div>test</div>
          ))}
        </div>
      </div>
    </div>
  );
};

const mapStateToProps = (state) => {
  return {
    sidebarOpen: state.navigation.sidebarOpen,
  };
};

const mapDispatchToProps = null;

export default connect(mapStateToProps, mapDispatchToProps)(LeftMenu);
